import './estilo.css';
import bannerClaro from '../../assets/bannerclaro.jpg'

export default function Home(props){
    return(
       <section id='home' className='secao-banner'>
        <img className='imgBanner' src={bannerClaro} alt='banner'/>
        <div className='apresentacao'>
            <h1>Ol√°, me chamo  <span>Jessica Suyane </span></h1>
            <p className='p-banner'>Sou Desenvolvedora Front-end </p>
        </div>
       </section>
    );
}
